import React from "react"

function CharComments ( { currentChar } ) {

    const comments = currentChar.comments.map((entry) => {
        console.log(entry)
        return (
            <>
                <ul>
                    <div>{entry.name}</div>
                    <div>{entry.content}</div>
                    <span className="score">{entry.score}</span>
                </ul>
            </>
        )
    })


    return(
        <>
        {comments}
        </>
    )
}

export default CharComments;
